import React from 'react';
import './Navigation.css';
import { Col, Navbar, Nav, NavItem } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import { LinkContainer } from 'react-router-bootstrap';
 
const navigation = (props) => {
    return (
        <Col md={12} >
            <Navbar inverse collapseOnSelect>

                    <Navbar.Brand href="#account-owner">Account-Owner</Navbar.Brand>
                    <Navbar.Brand>
                        <NavLink to={'/'} exact >Account-Owner</NavLink>
                    </Navbar.Brand>
                    <Navbar.Toggle />
                <Navbar.Collapse>
                    <Nav>
                        <Nav.Link to={'/owner-list'}> Owner Actions</Nav.Link>
                        <Nav.Link to={'/account-list'}>Account Actions</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        </Col>
    )
}
 
export default navigation;
